document.onload=function(e){var t=document.links;for(i=0;i<t.length;i++){var n=t[i];n.hasAttribute("rel")&&n.getAttribute("rel")=="external"&&n.setAttribute("target","_blank")}var r=document.getElementsByTagName("pre");for(i=0;i<r.length;i++){var s=r[i];s.addEventListener("mouseover",function(){this.style.overflow="visible"}),s.addEventListener("mouseout",function(){this.style.overflow="hidden"})}};